import { NgModule } from '@angular/core';
import { RouterModule, Routes } from '@angular/router';
import { MilitarListComponent } from './militar-list/militar-list.component';
import { CreateMilitarComponent } from './create-militar/create-militar.component';
import { UpdateMilitarComponent } from './update-militar/update-militar.component';
import { MilitarDetailsComponent } from './details-militar/details-militar.component';

const routes: Routes = [
   { path: 'militars-list', component: MilitarListComponent },
   { path: 'create-militar', component: CreateMilitarComponent },
   { path: 'update-militar/:id', component: UpdateMilitarComponent},
  { path:  'militar-details/id:', component: MilitarDetailsComponent }
];

@NgModule({
  imports: [RouterModule.forRoot(routes)],
  exports: [RouterModule]
})
export class AppRoutingModule { }
